Upper:
M1S 16" 9mm; A2 flash hider;
YHM customizable free float forearm w/ 1 full length rail section and two small rail sections included;
CMMG enhanced 9mm bolt carrier group;
Removable carry handle taken off a FN A4 upper;


Lower:
Essential Arms lower receiver;
CMMG ambidextrous safety selector;
Magpul enhanced trigger guard;
Magpul CTR stock, OD green;
Magpul MOE grip, OD green;
M1S 9mm mag adapter;
Enidine hydraulic buffer;

Comes with six 32 round ProMag 9mm magazines.

Asking $850 for everything. I'd like to sell this as a whole, but I will part it out if I need to; trying to fund another 9mm AR build. Also have a black Magpul rear MBUS and an OD sling I'll throw in if I don't have to drive two hours to meet you.

Also, if you have anything neat to trade, feel free to offer; worst I can say is no thanks.
